import "../style/exp.css";
import React from "react";

function exp() {
  return (
    <div className="experience" id="experience">
        <h1 className="heading text">EXPERIENCE</h1>
      <div className="exp">
        <div className="text1">
          <h2>Volunteering</h2>
          <p>Social Team At Coders Evoke</p>
        </div>
        <div className="text2">
          <h2>Participant LGMSoC'21</h2>
          <p></p>
        </div>
        <div className="text3">
          <h2>Participant GWoC'21</h2>
          <p></p>
        </div>
      </div>
    </div>
  );
}

export default exp;
